import React, { Component } from 'react';

class List extends Component {

  render() {
    return (
      <div id="list-container">
      {
        <div>
        this.props.filtered.map(l => {
          <h1>{l.FacilityName}</h1>

        })
        </div>
      }

      </div>
    );
  }

}

export default List;
